import React from "react";
import settings from "../../../src/assets/Icons/settings.png";
import eth from "../../../src/assets/Icons/eth.png";

import { FileArrowDown } from "react-bootstrap-icons";
export default function Swap() {
  const token1 = {
    name: "ETH",
    icon: eth,
  };

  const [selectedToken, setSelectedToken] = React.useState(token1);
  const [selectedToken2, setSelectedToken2] = React.useState({});

  return (
    // center div with glassmorphism
    <div
      className="container"
      style={{
        height: "40vh",
        width: "20vw",
        border: "1px solid rgba(255, 255, 255, 0.2)",
        backdropFilter: "blur(4px)",
        //rounded corners
        borderRadius: "30px",
      }}>
      <div className="row my-3">
        <div className="col-8">
          <h3
            style={{
              color: "white",
            }}>
            music-exchanger
          </h3>
        </div>

        <div className="col-4">
          <img
            alt="settings"
            src={settings}
            style={{
              height: "40px",
              width: "40px",
            }}
          />
        </div>
      </div>
    </div>
  );
}
